import Fundo from "./Fundo";
export default function fundos(props) {
  console.log(props.investments);
  return (
    <div>
      <h2>{props.investments.length}</h2>
      {props.investments.map((item) => {
        return <Fundo>{item}</Fundo>;
      })}
    </div>
  );
}
